function remove(n){swal({title:"Sure to delete this user?",type:"warning",showCancelButton:!0},function(){app.delete("/api/user/"+n,function(){window.location.reload()},function(){swal("Error","Delete failed","error")})})}function disable(n){swal({title:"Sure to lock this user?",type:"warning",showCancelButton:!0},function(){app.put("/api/user/"+n+"/disable",null,function(){window.location.reload()},function(){swal("Error","Lock failed","error")})})}function enable(n){app.put("/api/user/"+n+"/enable",null,function(){window.location.reload()},function(){swal("Error","Enable failed","error")})}$(function(){$("#Search").on("click",function(){window.location.href="/user?q="+$("#Keyword").val()})});